Adolf Hitler: The Greatest Story Never Told
Since the mid-20th century, the world has only ever heard one side of an incredible story. The story of a boy from an ordinary family whose ambition it was to become an artist, but who instead became a drifter.
His destiny however was not to drift into the awaiting oblivion, but to rise to the greatest heights of power, eventually to become one of the most influential men who ever lived.
Now for the first time, here is a documented account of a story many believe to be...The Greatest Story NEVER Told!
Learn the untold story about the most reviled man in history. Adolf Hitler, The Greatest Story Never Told is a 6-hour Documentary by TruthWillOut Films. This ground-breaking documentary chronicles the rise of Germany from defeat in World War I, to communist attempts to take over Germany; hyperinflation during the Weimar Republic, widespread unemployment and misery, and Adolf Hitler's rise to power. It also reveals a personal side of Adolf Hitler: who he was, his family background, his artwork and struggles in Vienna and what motivated him to come to power. There's so much hidden history to recount; FDR Pearl Harbor conspiracy, Soviet brutality, betrayal and treachery on all sides. Do we really know the true cost of war? Do we really possess all the facts?
Watch this series and uncover the real root causes of World War II. Do your own research and decide what you choose to believe.



11)  The Red Terror 
The Red Terror and the Partisans as the Wermacht retreat Westward at the Battle of Kursk then the Bloodiest Massacre at Katyn and the cover-ups.

12)  Mussolini 
Breaking man in Europe Otto Skorzeny called Operation Oak. Hitler chooses 3 Men to free Mussolini.Mussolini Out the daring Prison Break by the most Dangerous

13)  Roosevelt and Churchill 
Roosevelt and Churchill. This episode shows their hidden web of money and lies and the Billions the Americans invested into the Rise of Communism.

14)  General Leon DeGrelle 
General Leon DeGrelle, the most famous of the Waffen SS. &quot;My Honour is My Loyalty&quot;, he earned all stripes from Corporal to General, and died at 87 yrs.

15)  Battle of the Bulge 
Battle of the Bulge, which nearly turned the War on it's head; the march through Moscow to the Gulag; and one man's heroic escape home to his family.




